import React, {createContext} from "react";
import ComA from "./ComA";


const FirstName = createContext();
const LastName = createContext();

const App = () =>{
    return (
        <>
            <FirstName.Provider value={"cherry"}>
                <LastName.Provider value={"charan"}>  </LastName.Provider>  
             <ComA /> </FirstName.Provider>
        </>
        );
};

export default App; 
export {FirstName};
